--[[
Variables: 12,
----------------------------------------------------------------------------------------------------------------------------------------
                                                           ENGLISH VERSION
TbApi.logsend("Text") - Prints you text that you put in(F9 to open console.)
TbApi.Parts(workspace.Map) - Do something with all Parts that are in Map Model. You can do :Destroy(), .Parent = 'Lighting', etc...
TbApi.Towers() - Prints you in console(F9) all Towers in Towers Folder.
TbApi.EquipTower("Tower1","Scout") - Equips a Tower = "Slot","Tower", Currently slots are: Tower1,Tower2,Tower3,Tower4,Tower5.
TbApi.RemoveTower("Tower1","Scout") - Removes a Tower = "Slot","Tower", Currently slots are: Tower1,Tower2,Tower3,Tower4,Tower5.
TbApi.PlaceTower(Vector3.new(1,1,1),"Patrol") - Places a Tower in Position that you put.
TbApi.SellTower(1) - Sells a Tower, Requires hes Number that you can get with TbApi.Towers().
TbApi.UpgradeTower(1,3) - TowerNumber,ReachLvl , Upgrades a Tower to reach lvl(4 for max lvl, 3 for 4 lvl), Requires hes Number that you can get with TbApi.Towers().
TbApi.Joiner("SurvivalSolo") - Joins you in Gamemode that you choosed, NOT WORKING IN EVENT. Currently Gamemodes are:
Versus: 1v1,2v2,3v3,4v4;
Survival: SurvivalSolo,SurvivalCoOp,SurvivalTriOp,SurvivalQuadOp.
TbApi.CreateParty() - Creates a Party.
TbApi.LeaveParty() - Leaves from Party.
TbApi.InviteParty("User") - Invites a User that you put in(not working with display names.)

----------------------------------------------------------------------------------------------------------------------------------------
                                                           RUSSIAN VERSION
TbApi.logsend("Text") - Высылает вам текст который вы вставили(F9 чтобы открыть консоль.)
TbApi.Parts(workspace.Map) - Делает что то со всеми платформами. Вы можете сделать :Destroy(), .Parent = 'Lighting', и так далее...
TbApi.Towers() - Высылает вам в консоль(F9) всех товеров которые в папке Towers.
TbApi.EquipTower("Tower1","Scout") - Берет Товера = "Слот","Товер", Слоты: Tower1,Tower2,Tower3,Tower4,Tower5.
TbApi.RemoveTower("Tower1","Scout") - Уберает Товера = "Слот","Товер", Tower1,Tower2,Tower3,Tower4,Tower5.
TbApi.PlaceTower(Vector3.new(1,1,1),"Patrol") - Ставит Товера в позицию которую вы указали.
TbApi.SellTower(1) - Продает Товера, Нужна его цифра которую вы можете узнать с помощью TbApi.Towers().
TbApi.UpgradeTower(1,3) - ЦифраТовера,МаксУровень , Улучшает уровень Товера(4 для максимального уровня, 3 для 4 уровня), Улучшает Товера, Нужна его цифра которую вы можете узнать с помощью TbApi.Towers().
TbApi.Joiner("SurvivalSolo") - Добавляет вас в игру которую вы выбрали, НЕ РАБОТАЕТ В ИВЕНТЕ. Игры на данный момент:
ПВП: 1v1,2v2,3v3,4v4;
Выживание: SurvivalSolo,SurvivalCoOp,SurvivalTriOp,SurvivalQuadOp.
TbApi.CreateParty() - Создает Пати.
TbApi.LeaveParty() - Выходит с Пати.
TbApi.InviteParty("User") - Приглашает Человека которого вы указали в Пати(не работает с дисплей никами.)
]]

